import { NavLink } from "react-router-dom";

class PatientLogin extends Component {
  constructor(props)
  {    
	super()
	this.state = { data: 'test' }
  }

  render() {    
  return(

    <div>

   <label>{this.state.data1}</label>

</div>

    );
  }
};

export default PatientLogin;
